import React, { useEffect, useState } from 'react';
import { getAllDamagedDefects } from '../../API'
const Dashboard = () => {
    const [loading, setLoading] = useState<boolean>(true)
    const [damageData, setDamageData] = useState<ApiDataType>();

    const doFetch = async () => {
        setLoading(true);
        const data = await getAllDamagedDefects();
        console.log(data.data)
        setDamageData(data.data)
        setLoading(false);
    };


    return (
        <div>
            <button onClick={doFetch}>Get DD Forms</button>
        </div>
    )
}

export default Dashboard;
